			},
			getValue() {
			  this.searchmsg= this.data.inputmsg;
			},
		},
		/**
		 * 生命周期函数--监听页面加载
		 */
		onLoad(options) {
		  const app = getApp();
		  let app_userInfo = app.globalData.app_userInfo;
		  if (app_userInfo === null) {
		      this.lingquan= "../loginx/loginx",
		      this.deliverPath = "../loginx/loginx",
		      this.navigatorWay = "redirect"
		  } else {
		      this.lingquan = "../list/list",
		      this.deliverPath = "../list/list",
		      this.navigatorWay = "switchTab"
		  };
		},
		/**
		 * 生命周期函数--监听页面初次渲染完成
		 */
		onReady() {
		  const app = getApp();
		  let app_userInfo = app.globalData.app_userInfo;
		  if (app_userInfo === null) {
		      this.lingquan = "../loginx/loginx";
		      this.deliverPath = "../loginx/loginx";
		      this.navigatorWay = "redirect";
		  } else {
		      this.lingquan = "../list/list";
		      this.deliverPath = "../list/list";
		      this.navigatorWay = "switchTab";
		  };
		  wx.cloud.database().collection("swipper-list").get({
		    success: ans => {
		      this.swiperImages = ans.data;
		    }
		  })
		},
		/**
		 * 生命周期函数--监听页面显示
		 */
		onShow() {
		  const app = getApp();
		  let app_userInfo = app.globalData.app_userInfo;
